import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


class Car extends React.Component{

    render(){
        return(
            <div className="jumbotron">
                    <h1>{this.props.brand.model}</h1>
            </div>
    
        )
    }
}
export default Car;
